import{_ as o,D as n,c as s,I as i,w as r,j as e,a as l,a3 as t,o as c}from"./chunks/framework.BdWiaA81.js";const d="/assets/windows_overview_light.BRfhEdJk.png",p="/assets/windows_overview_dark.BxvTTOLX.png",h="/assets/windows_installer_location.BieQsGWa.png",q=JSON.parse('{"title":"Windows","description":"","frontmatter":{},"headers":[],"relativePath":"installation/windows.md","filePath":"installation/windows.md","lastUpdated":1688637431000}'),_={name:"installation/windows.md"},u=d+"#only-light",m=p+"#only-dark",f=e("h1",{id:"windows",tabindex:"-1"},[l("Windows "),e("a",{class:"header-anchor",href:"#windows","aria-label":'Permalink to "Windows"'},"​")],-1),w=e("p",null,"For Windows users, there is one build and one variant available:",-1),b=e("ul",null,[e("li",null,"amd64 (NSIS installer + portable exe for USB drives)")],-1),g=e("p",null,[e("img",{src:u,alt:""}),e("img",{src:m,alt:""})],-1),y=t('<div class="tip custom-block github-alert"><p class="custom-block-title">TIP</p><p>While October should work on older versions of Windows, it has only officially been tested on Windows 11.</p><p>You may be prompted upon first start to install <a href="https://developer.microsoft.com/en-us/microsoft-edge/webview2/" target="_blank" rel="noreferrer">WebView2</a> which is a component of Windows used by October.</p><p>It is included by default on Windows 11 but will need to be manually installed on older Windows versions.</p></div><h2 id="installation" tabindex="-1">Installation <a class="header-anchor" href="#installation" aria-label="Permalink to &quot;Installation&quot;">​</a></h2><p>For experienced Windows users, there&#39;s nothing fancy about the installation process. It&#39;s a stock standard install wizard.</p><p>To get started, you&#39;ll want to get a copy of the latest installer from <a href="https://github.com/marcus-crane/october/releases" target="_blank" rel="noreferrer">Github Releases</a> which has the file format of <code>october_&lt;version&gt;_windows_amd64.zip</code>.</p><p>Once downloaded, you&#39;ll find an application installer within the zip file.</p><p>Running it will present you with a fairly standard install wizard.</p>',6),v=e("p",null,[e("img",{src:h,alt:""})],-1),k=t('<p>As mentioned, there aren&#39;t any custom options so you&#39;ll just want to click Next until the process is complete.</p><p>You should find an entry in your start menu and a shortcut on your desktop.</p><h2 id="technical-details" tabindex="-1">Technical Details <a class="header-anchor" href="#technical-details" aria-label="Permalink to &quot;Technical Details&quot;">​</a></h2><p>If you&#39;re curious about any files that are generated or need to manually wipe October from existence, here are the following places that files are created:</p><h3 id="application" tabindex="-1">Application <a class="header-anchor" href="#application" aria-label="Permalink to &quot;Application&quot;">​</a></h3><p>The main October app lives at <code>C:\\Program Files\\utf9k\\October</code> and is self contained as far as the shipped binary is concerned.</p><p>You can uninstall it by searching for October in the start menu, and selecting <code>Uninstall</code> or finding it via <code>Add or Remove Programs</code> in your system settings.</p><h3 id="logs" tabindex="-1">Logs <a class="header-anchor" href="#logs" aria-label="Permalink to &quot;Logs&quot;">​</a></h3><p>These are stored at <code>C:\\Users\\&lt;username&gt;\\AppData\\Local\\october\\logs</code> with one log file created each time the application is launched.</p><p>Logs are in <a href="http://ndjson.org/" target="_blank" rel="noreferrer">ndjson</a> format and use the naming convention of <code>&lt;current unix timestamp&gt;.json</code>.</p><h3 id="settings" tabindex="-1">Settings <a class="header-anchor" href="#settings" aria-label="Permalink to &quot;Settings&quot;">​</a></h3><p>October&#39;s internal settings are stored in a JSON file that lives at <code>C:\\Users\\&lt;username&gt;\\AppData\\Local\\october\\config.json</code>.</p>',12);function T(x,P,S,W,A,I){const a=n("center");return c(),s("div",null,[f,w,b,g,y,i(a,null,{default:r(()=>[v]),_:1}),k])}const N=o(_,[["render",T]]);export{q as __pageData,N as default};
